class Sum{
	int num1, num2, num3;
	public Sum(int num1, int num2) 
	{
		this.num1 = num1;
		this.num2 = num2;
	}
	
	public Sum(int num1, int num2, int num3) 
	{
		this.num1 = num1;
		this.num2 = num2;
		this.num3 = num3;
	}
	
}